import './App.css';
import Todo from './Todo';

const todos = [
  { id: 1, message: 'Be confident' },
  { id: 2, message: 'Shoulders back' },
  { id: 3, message: 'Chin towards God' }
]

import Todos from './components/Todos';

function App() {
  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
